% PURPOSE:  Returns the n-th transport coefficient sigma.
%           Use tabulated data and linear interpolation for evaluation.
%           material:       278: Water,    Z = 10              rho = 1
%                           [Z = atomic number   rho = density in g/cm^3]
%           polynomial:     Legendre Polynomials P_n(mu)

% INPUT:    energy E    =    5e-5 MeV ... 100 MeV
%           type        =    'el':        elastic transport coefficient
%                            'tot':       total transport coefficient
%           n           =    0 ... 39

% OUTPUT:   n-th transport coefficient
%           sigma^el_n(E)  = int(polynomial_n(mu)*sigma_elastic(E,mu),mu,-1,1).
%           sigma^tot_n(E) = int(polynomial_n(mu)*(sigma_elastic(E,mu)+sigma_inelastic(E,mu)),mu,-1,1).

% UNITS:    [sigma]     =   1/cm
%           [E]         =   MeV
%           type        =   string
%           n           =   natural number

% EXPLANATIONS:     elastic scattering cross section   =  non-radiative interaction between electrons and the atomic shell. Projectiles experience small deflections and lose little energy.
%                   inelastic scattering cross section =  e-e scattering leading to excitation/ionisation of the target. Both small and large energy transfers/deflections  are possible.

% REFERENCES    
% Tabulated Data:          ICRU-77, Elastic Scattering of Electrons and Positrons, vol.7, Oxford University Press, 2007
% Atomic number, density:  PENELOPE-2008, A Code System for Monte Carlo Simulation of Electron and Photon Transport, Block Data Pendat


function sigma = TransportCoefElectronsP39(E,type,n)

if any(E<5e-5) || any(E>1e2)
    error('Energy E out of range. Note that E = 5e-5 MeV ... 100 MeV');
end

